import React from "react";
import "./Header.css";

const Header = props => (
  <div className="jumbotron bg-dark text-light">
    <h3 className="header">{props.children}</h3>
    <div className="points">
      Score: {props.score}<br></br>
      High-Score: {props.highscore}
    </div>
  </div>
);

export default Header;
